import ExpenseItem from "./Components/ExpenseItem";
function App() {
  const expense = [
    {id : 'e1', title: 'Toilet Paper', amount: 200, date: new Date(2023, 5, 10)},
    {id : 'e2', title: 'Car Insurance', amount: 200, date: new Date(2023, 5, 10)},
    {id : 'e3', title: 'Car Insurance', amount: 200, date: new Date(2023, 5, 10)},
    {id : 'e4', title: 'Car Insurance', amount: 200, date: new Date(2023, 5, 10)} 
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expense[0].title} amount={expense[0].amount} date={expense[0].date}></ExpenseItem>
      <ExpenseItem title={expense[1].title} amount={expense[1].amount} date={expense[1].date}></ExpenseItem>
      <ExpenseItem title={expense[2].title} amount={expense[2].amount} date={expense[2].date}></ExpenseItem>
    </div>
  );
}

export default App;
